import React, { useState } from "react";
import Button from 'react-bootstrap/Button';
import Form from 'react-bootstrap/Form';
import DatePicker from 'react-datepicker';
import 'react-datepicker/dist/react-datepicker.css';
import axios from 'axios';

const Seller = () => {
    const [formData, setFormData] = useState({
        name: '',
        email: '',
        departureCity: '',
        destination: '',
        date: new Date(),
        time: '',
        availableSpace: '',
        askingPrice: '',
        additionalInfo: ''
    });
    const [errors, setErrors] = useState({});

    const handleInputChange = (e, field) => {
        setFormData({ ...formData, [field]: e.target.value });
    };

    const handleDateChange = (date) => {
        setFormData({ ...formData, date: date });
    };

    const validateForm = () => {
        let tempErrors = {};
        if (!formData.name) tempErrors.name = "Name is required";
        if (!formData.email) tempErrors.email = "Email is required";
        // Add more validation as per your requirement
        setErrors(tempErrors);
        return Object.keys(tempErrors).length === 0;
    };

    const handleSubmit = async (e) => {
        e.preventDefault();
        if (validateForm()) {
            try {
                const response = await axios.post('http://localhost:5000/api/listings', formData);
                console.log(response.data);
            } catch (error) {
                console.error("Error submitting form:", error);
            }
        }
    };

    return (
        <div className="introTag">
            <h1 style={{ marginTop: "100px" }}>Hi, post your listing</h1>
            <Form onSubmit={handleSubmit}>
                <Form.Group className="mb-3" controlId="formBasicName">
                    <Form.Label>Name</Form.Label>
                    <Form.Control 
                        type="text" 
                        placeholder="Enter name" 
                        value={formData.name}
                        onChange={(e) => handleInputChange(e, 'name')} 
                        isInvalid={!!errors.name}
                    />
                    <Form.Control.Feedback type="invalid">
                        {errors.name}
                    </Form.Control.Feedback>
                </Form.Group>
                <Form.Group className="mb-3" controlId="formBasicEmail">
                    <Form.Label>Email Address</Form.Label>
                    <Form.Control 
                        type="email" 
                        placeholder="Enter email" 
                        value={formData.email}
                        onChange={(e) => handleInputChange(e, 'email')} 
                        isInvalid={!!errors.email}
                    />
                    <Form.Control.Feedback type="invalid">
                        {errors.email}
                    </Form.Control.Feedback>
                </Form.Group>
                <Form.Group className="mb-3" controlId="formBasicDepartureCity">
                    <Form.Label>Departure City</Form.Label>
                    <Form.Control 
                        type="text" 
                        placeholder="Enter departure city" 
                        value={formData.departureCity}
                        onChange={(e) => handleInputChange(e, 'departureCity')} 
                    />
                </Form.Group>
                <Form.Group className="mb-3" controlId="formBasicDestination">
                    <Form.Label>Destination</Form.Label>
                    <Form.Control 
                        type="text" 
                        placeholder="Enter destination" 
                        value={formData.destination}
                        onChange={(e) => handleInputChange(e, 'destination')} 
                    />
                </Form.Group>
                <Form.Group className="mb-3" controlId="formBasicDate">
                    <Form.Label>Date</Form.Label>
                    <DatePicker
                        selected={formData.date}
                        onChange={handleDateChange}
                        className="form-control"
                    />
                </Form.Group>
                <Form.Group className="mb-3" controlId="formBasicTime">
                    <Form.Label>Time</Form.Label>
                    <Form.Control 
                        type="time" 
                        value={formData.time}
                        onChange={(e) => handleInputChange(e, 'time')} 
                    />
                </Form.Group>
                <Form.Group className="mb-3" controlId="formBasicAvailableSpace">
                    <Form.Label>Available Space</Form.Label>
                    <Form.Control 
                        type="text" 
                        placeholder="Enter available space" 
                        value={formData.availableSpace}
                        onChange={(e) => handleInputChange(e, 'availableSpace')} 
                    />
                </Form.Group>
                <Form.Group className="mb-3" controlId="formBasicAdditionalInfo">
                    <Form.Label>Anything that Buyer Should Know?</Form.Label>
                    <Form.Control 
                        as="textarea" 
                        rows={3} 
                        placeholder="Enter additional information" 
                        value={formData.additionalInfo}
                        onChange={(e) => handleInputChange(e, 'additionalInfo')} 
                    />
                </Form.Group>
                <Button variant="primary" type="submit">
                    Post My Listing
                </Button>
            </Form>
        </div>
    );
};

export default Seller;
